// src/components/CloudEdgeLogo.jsx
import React from 'react';

const CloudEdgeLogo = ({ className }) => (
  <svg className={className} viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
    {/* Cloud Base */}
    <path
      d="M18 18H8C5.23858 18 3 15.7614 3 13C3 10.2386 5.23858 8 8 8C8.55229 8 9.08166 8.08566 9.57874 8.24408C10.6437 5.77021 13.1162 4 16 4C19.866 4 23 7.13401 23 11C23 14.866 19.866 18 16 18"
      stroke="currentColor"
      strokeWidth="2"
      strokeLinecap="round"
      strokeLinejoin="round"
    />
    {/* Edge/Network Lines */}
    <path
      d="M12 12L16 8M16 8L20 12M16 8V20"
      stroke="currentColor"
      strokeWidth="2"
      strokeLinecap="round"
      strokeLinejoin="round"
    />
    {/* Connection Points */}
    <circle cx="16" cy="8" r="1" fill="currentColor" />
    <circle cx="12" cy="12" r="1" fill="currentColor" />
    <circle cx="20" cy="12" r="1" fill="currentColor" />
    <circle cx="16" cy="20" r="1" fill="currentColor" />
  </svg>
);

export default CloudEdgeLogo;
